#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <stdbool.h>
void
map(char *str, int *result)
{
	int		abc        [1000], i;
	int		len = strlen(str);
	int		tmp        [len];
	memset(abc, 0, sizeof(int) * 1000);
	memset(result, 0, sizeof(int) * len);
	memset(tmp, 0, sizeof(int) * len);
	int		index;
	for (i = 0; i < len; i++) {
		index = str[i];
		abc[index]++;
	}
	for (i = 0; i < len; i++) {
		index = str[i];
		result[i] = abc[index];
	}
	return;
}

bool
isIsomorphic(char *s, char *t)
{
	int		i         , len = strlen(s);
	int		results    [len], resultt[len];
	map(s, results);
	map(t, resultt);
	for (i = 0; i < len; i++)
		if (results[i] != resultt[i])
			return 0;
	return 1;
}

